#RegisterClientSbc

$subdomainFQDN = 'atlanticgrupa.sbc1.callfromteams.hr'
$usageName = 'CFT_Calls'
$voiceRouteName = 'AG_Sbc1Route'
$policyName = 'AllowAllCalls'

if ($usageName -in (Get-CsOnlinePstnUsage).Usage) {
    Write-Output 'PSTN Usage already exists!'
}
else {
    Write-Output 'Adding new PSTN Usage...'
    Set-CsOnlinePSTNUsage -Usage @{Add = $usageName}
    Start-Sleep -Seconds 20
}

if (('Tag:' + $policyName) -in (Get-CsOnlineVoiceRoutingPolicy).Identity) {
    Write-Output 'Online Voice Routing Policy already exists!'
}
else {
    Write-Output 'Adding new Online Voice Routing Policy'
    New-CsOnlineVoiceRoutingPolicy $policyName -OnlinePstnUsages $usageName
    Start-Sleep -Seconds 10
}

if ($voiceRouteName -in (Get-CsOnlineVoiceRoute).Identity) {
    Write-Output 'Online Voice Route already exists!'
}
else {
    Write-Output 'Adding new Online Voice Route...'
    New-CsOnlineVoiceRoute -Identity $voiceRouteName -Priority 1 -NumberPattern '.*' -OnlinePstnGatewayList $subdomainFQDN -OnlinePstnUsages $usageName
}

#AddDialPlan

$dialPlanName = 'Combis_Plan'

if (('Tag:' + $dialPlanName) -in (Get-CsTenantDialPlan).Identity) {
    Write-Output 'Dial Plan already exists!'
}
else {
    Write-Output 'Adding Dial Plan...'
    New-CsTenantDialPlan -Identity $dialPlanName -Description 'Combis Dail Plan'
 
