    $nr3 = New-CsVoiceNormalizationRule -Parent $dialPlanName -Name 'HR Tool Free Numbers' -Description 'HR Tool Free Numbers' -Pattern '^0(800\d*)$' -Translation '+385$1' -InMemory
    $nr4 = New-CsVoiceNormalizationRule -Parent $dialPlanName -Name 'HR Road Emergency Number' -Description 'HR Road Emergency Number' -Pattern '^(1987)$' -Translation '$1' -InMemory
    $nr5 = New-CsVoiceNormalizationRule -Parent $dialPlanName -Name 'HR Mobile calling (TELE2, Tomato, A1, bonbon)' -Description 'HR Mobile calling (TELE2, Tomato, A1, bonbon)' -Pattern '^0(9[12579]\d{7})$' -Translation '+385$1' -InMemory
    $nr6 = New-CsVoiceNormalizationRule -Parent $dialPlanName -Name 'HR Mobile calling (T-Mobile - 6 digit)' -Description 'HR Mobile calling (T-Mobile - 6 digit)' -Pattern '^0(98[2-8]\d{5})$' -Translation '+385$1' -InMemory
    $nr7 = New-CsVoiceNormalizationRule -Parent $dialPlanName -Name 'HR Mobile calling (T-Mobile - 7 digit)' -Description 'HR Mobile calling (T-Mobile - 7 digit)' -Pattern '^0(98[19]\d{6})$' -Translation '+385$1' -InMemory
    $nr8 = New-CsVoiceNormalizationRule -Parent $dialPlanName -Name 'HR Local Landline' -Description 'HR Local Landline' -Pattern '^0([1-5]\d{7})$' -Translation '+385$1' -InMemory
    $nr9 = New-CsVoiceNormalizationRule -Parent $dialPlanName -Name 'HR Taxi' -Description 'HR Taxi' -Pattern '^(1212|1414|1717)$' -Translation '0$1' -InMemory
    $nr10 = New-CsVoiceNormalizationRule -Parent $dialPlanName -Name 'Taxi pomoćni' -Description 'HR Taxi pom' -Pattern '^(01212|01414|01717)$' -Translation '$1' -InMemory
    $nr11 = New-CsVoiceNormalizationRule -Parent $dialPlanName -Name 'HR Emergency Number' -Description 'HR Emergency Number' -Pattern '^(11[23]|19[2345])$' -Translation '$1' -InMemory
 
    Set-CsTenantDialPlan -Identity $dialPlanName -NormalizationRules @{Add = $nr1, $nr2, $nr3, $nr4, $nr5, $nr6, $nr7, $nr8, $nr9, $nr10, $nr11}
}

