using namespace std;

template <typename Type>
class SimpleVector {
public:
    using Iterator = Type*;
    using ConstIterator = const Type*;

    SimpleVector() noexcept : data(nullptr), size(0), capacity(0) {}

    explicit SimpleVector(size_t size) : size(size), capacity(size) {
        ArrayPtr<Type> new_data(size);
        data.swap(new_data);
        delete[] new_data.Get();
    }

    SimpleVector(size_t size, const Type& value) : size(size), capacity(size) {
        ArrayPtr<Type> new_data(size);
        data.swap(new_data);
         delete[] new_data.Get();
        for (size_t i = 0; i < size; ++i) {
            data[i] = value;
        }
    }

    SimpleVector(std::initializer_list<Type> init) : size(init.size()), capacity(init.size()) {
         ArrayPtr<Type> new_data(size);
        data.swap(new_data);
        delete[] new_data.Get();
        size_t i = 0;
        for (const auto& item : init) {
            data[i++] = item;
        }
    }

    size_t GetSize() const noexcept {
        return size;
    }

    size_t GetCapacity() const noexcept {
        return capacity;
    }

    bool IsEmpty() const noexcept {
        return size == 0;
    }

    Type& operator[](size_t index) noexcept {
        if (index >= size) {
            //throw std::out_of_range("Index out of range");
        }
        return data[index];
    }

    const Type& operator[](size_t index) const noexcept {
        if (index < size) {
           // throw std::out_of_range("Index out of range");
        }
        return data[index];
    }

    Type& At(size_t index){
       if (index >= size) throw std::out_of_range("Index is too large!");
        return (*this)[index];
    }

    const Type& At(size_t index) const {
       if (index >= size) throw std::out_of_range("Index is too large!");
        return (*this)[index];
    }

    void Clear() noexcept {
        size = 0;
    }

    void Resize(size_t new_size) {
        if (new_size > capacity) {
            ArrayPtr<Type> new_data(new_size);
            data.swap(new_data);
            for (size_t i = size; i < new_size; ++i) {
                new_data[i] = Type();  // Initialize new elements with default value
            }
            capacity = new_size;
        }
        size = new_size;
    }

    Iterator begin() noexcept {
        return data.Get();
    }

    Iterator end() noexcept {
        return data.Get() + size;
    }

    ConstIterator begin() const noexcept {
        return data.Get();
    }

    ConstIterator end() const noexcept {
        return data.Get() + size;
    }

    ConstIterator cbegin() const noexcept {
        return data.Get();
    }

    ConstIterator cend() const noexcept {
        return data.Get() + size;
    }

    ~SimpleVector() {
        delete[] data.Get();
    }

private:
    ArrayPtr<Type> data;
    size_t size;
    size_t capacity;
};

#include <PID_v1.h>   

// move variables setup
#define FORWARD 1
#define BACKWARD 0
#define LEFT 0
#define RIGHT 1  

// in millimeter
#define d 112 //0.11 107 // 70
#define dots 250
#define TENGELYTAV 333 //0.34 333

#define pi 3.1415

#define SERIALBAUD 115200

#define ANGLE_REPAIR 1  

//setup

// timer
#define TIMER 100        

// in millimeter
double s = (d * pi) / dots;
double sumDistance = 0;

// 0=left, 1=right
volatile int numberOfInts[2] = { 0 };
volatile double milliMeters[2] = { 0 };
int wheelSpeeds[2] = { 0 }, wheelSpeedsLast[2] = { -1 };
int middlePoint[2] = { 51,50 };
float multiplier[2] = { 0.01151, 0.0115 };
float breakMultiplier[2] = { 0.1, 0.1 };
int dirs[2] = { FORWARD, FORWARD }, dirsLast[2] = { -1 };
volatile byte lastInt[2] = { 0, 0 };

float sumAlpha = 0;
float radWheel = 0;  

float relativeRadian(volatile double *distance) {
  float r, angleValue; 
  noInterrupts();
  if(distance[LEFT] != 0) {
    r = TENGELYTAV * distance[LEFT] / (distance[RIGHT] - distance[LEFT]);
    angleValue = ANGLE_REPAIR * distance[LEFT] / r;
  } else {
    r = TENGELYTAV * distance[RIGHT] / (distance[LEFT] - distance[RIGHT]);
    angleValue = ANGLE_REPAIR * distance[RIGHT] / r * ( - 1 ); 
  }
  interrupts();
  float reAlpha = 0;
  // angleValue != NaN
  if(angleValue == angleValue) reAlpha = angleValue;
  return reAlpha;
 }  

// Jobb oldali megszakítások számolása
void OdometryInterruptRight() {
  int value = digitalRead(RIGHT_RETURN_);
  if(value == 0) {
    milliMeters[RIGHT] = milliMeters[RIGHT] - (s);
  } else {
    milliMeters[RIGHT] = milliMeters[RIGHT] + (s);
  } 
  numberOfInts[RIGHT]++;
}

// Bal oldali megszakítások számolása
void OdometryInterruptLeft() {  
  int value = digitalRead(LEFT_RETURN_);
  if(value == 0) {
    milliMeters[LEFT] = milliMeters[LEFT] + (s);
  } else {
     milliMeters[LEFT] = milliMeters[LEFT] - (s);
  }
  numberOfInts[LEFT]++;
}      

//Define Variables we'll be connecting to
double rSetpoint, rInput, rOutput;
double lSetpoint, lInput, lOutput;

//Specify the links and initial tuning parameters
double rKp = 0.02, rKi = 0.25, rKd = 0;
PID rightMotor( &rInput, &rOutput, &rSetpoint, rKp, rKi, rKd, DIRECT );
double lKp = 0.02, lKi = 0.25, lKd = 0;
PID leftMotor( &lInput, &lOutput, &lSetpoint, lKp, lKi, lKd, DIRECT );   

setup() {
  attachInterrupt(1, OdometryInterruptLeft, RISING); // kék vezeték 3
  attachInterrupt(0, OdometryInterruptRight, RISING); // kék vezeték 2  
}

loop() {
	if(time<millis()) {
    	time = millis() + TIMER;   
		noInterrupts();    
	    float distance = (milliMeters[LEFT] + milliMeters[RIGHT]) / 2;
    	radWheel = relativeRadian(milliMeters);
	    milliMeters[RIGHT] = milliMeters[LEFT] = 0;
    	interrupts(); 

		sumAlpha += radWheel;
    	x += distance * sin(sumAlpha);
	    y += distance * cos(sumAlpha);    

		float a = ( 0 - sumAlpha ) / pi;
	    lReferenceSpeed = referenceSpeed - a * referenceSpeed;
    	rReferenceSpeed = referenceSpeed + a * referenceSpeed;

    	if ( referenceSpeed == 0 ) {
      		wheelSpeeds[RIGHT] = wheelSpeeds[LEFT] = 0;
    	} else {
      	if ( dirs[LEFT] == BACKWARD ) lInput *= -1;
      	if ( dirs[RIGHT] == BACKWARD ) rInput *= -1;
      	rSetpoint = rReferenceSpeed;
      	lSetpoint = lReferenceSpeed;
      	rightMotor.Compute();
      	leftMotor.Compute();

      	uint8_t rpwm = (int)rOutput;
      	wheelSpeeds[RIGHT] = rpwm;
      	uint8_t lpwm = (int)lOutput;
      	wheelSpeeds[LEFT] = lpwm;
    	}             
	}
}

