unit treecfgtkdirttartdost;

interface

uses
  Classes, VirtualTrees;

type
  TNodeClass = class of TNode;
  TNode = class(TObject)
  private
    FItems: TList;
    FID: integer;
    FName: string;
    FVTNode: PVirtualNode;
    function GetItemCount: integer;
    function GetItem(AIndex: integer): TNode;
  public
    procedure Clear;
    destructor Destroy; override;
    function AddItem(AClass: TNodeClass=nil; AId: integer=0; AName: string=''): TNode;
    property ItemCount: integer read GetItemCount;
    property Items[Index: Integer]: TNode read GetItem; default;
    property ID: integer read FID write FID;
    property Name: string read FName write FName;
    property VTNode: PVirtualNode read FVTNode write FVTNode;
  end;
  PNode = ^TNode;
  TContact = class(TNode)
  public
    FirstName: string;
    LastName: string;
    PhoneNumber: string;
  end;
  TContactCategory = class(TNode)
  public
    CategoryName: string;
    Count: integer;
  end;

  //Настройка использования типа тарифа-типа доставки для ТК-направления
  TTreeCfgTkDirTTarTDost = class(TVirtualStringTree)
  private
    Root: TNode;
    procedure VSTGetText(Sender: TBaseVirtualTree; Node: PVirtualNode; Column: TColumnIndex;
      TextType: TVSTTextType; var CellText: UnicodeString);
    procedure AddNodestoTree(ParentNode: PVirtualNode; Node: TNode);
  protected
  public
    constructor Create(AOwner: TComponent);override;
    destructor Destroy; override;
  end;

implementation

uses
  SysUtils;

procedure TTreeCfgTkDirTTarTDost.AddNodestoTree(ParentNode: PVirtualNode;
  Node: TNode);
var
  i: integer;
  SubNode: TNode;
  ThisNode: PVirtualNode;
begin
  if Node=Root then
    ThisNode := nil //Не высвечиваю Root
  else
  begin
    ThisNode := AddChild(ParentNode, Node);
    ThisNode.CheckState := csCheckedNormal;
    ThisNode.CheckType := ctCheckBox;
  end;
//    Node.CheckType := LevelToCheckType[Data.Level];
//    Sender.CheckState[Node] := csCheckedNormal;
//    CheckImageKind = ckDarkTick
//    CustomCheckImages = TreeImages
  Node.VTNode := ThisNode;
  for i:=0 to Node.ItemCount-1 do
  begin
    SubNode := Node[i];
    AddNodestoTree(ThisNode, SubNode);
  end;
end;

constructor TTreeCfgTkDirTTarTDost.Create(AOwner: TComponent);
var
  group_: TNode;
  Contact_: TContact;
  Category_: TContactCategory;
begin
  inherited;
{
  Colors.BorderColor = clWindowText
  Colors.HotColor = clBlack
  DragMode = dmAutomatic
  DragType = dtVCL
}
  Header.AutoSizeIndex := -1;
{
  Header.Font.Charset := DEFAULT_CHARSET;
  Header.Font.Color := clWindowText;
  Header.Font.Height := -11;
  Header.Font.Name := 'MS Sans Serif';
  Header.Font.Style := [];
}
  Header.MainColumn := -1;
  Header.Options := [hoColumnResize];
  HintAnimation := hatNone;
  IncrementalSearch := isAll;
  TreeOptions.AnimationOptions := [toAnimatedToggle];
  TreeOptions.AutoOptions := [toAutoDropExpand, toAutoTristateTracking];
  TreeOptions.MiscOptions := [toCheckSupport, toEditable, toInitOnSave, toToggleOnDblClick, toWheelPanning];
  TreeOptions.PaintOptions := [toShowButtons, toShowRoot, toShowTreeLines, toThemeAware, toUseBlendedImages];
  TreeOptions.SelectionOptions := [toMultiSelect, toCenterScrollIntoView];

  OnGetText := VSTGetText;
  NodeDataSize := SizeOf(Pointer);
  Root := TNode.Create;

  group_ := Root.AddItem(TNode,-1, 'Contacts');
  // Add some contacts
    Contact_ := group_.AddItem(TContact) as TContact;
      Contact_.FirstName := 'Семен';
      Contact_.LastName := 'Семеныч';
      Contact_.PhoneNumber := '1-111-111';
    Contact_ := group_.AddItem(TContact) as TContact;
      Contact_.FirstName := 'Тамара';
      Contact_.LastName := 'Васильевна';
      Contact_.PhoneNumber := '2-222-222';
  // Create the "Recent Calls" leaf
  group_ := Root.AddItem(TNode, -1, 'Recent Calls');
    Category_ := group_.AddItem(TContactCategory) as TContactCategory;
      Category_.CategoryName := '+00 (000) 00.00.00';
      Category_.Count := 11;
    Category_ := group_.AddItem(TContactCategory) as TContactCategory;
      Category_.CategoryName := '+00 (001) 12.34.56';
      Category_.Count := 22;
      
  NodeDataSize := SizeOf(Pointer);
  AddNodesToTree(nil, Root);
end;

destructor TTreeCfgTkDirTTarTDost.Destroy;
begin
  Root.Free;
  inherited;
end;

procedure TTreeCfgTkDirTTarTDost.VSTGetText(Sender: TBaseVirtualTree;
  Node: PVirtualNode; Column: TColumnIndex; TextType: TVSTTextType;
  var CellText: UnicodeString);
var
  PayloadObject:TObject;
  Node_: TNode;
  Contact : TContact;
  ContactCategory : TContactCategory;
begin
  PayloadObject := TObject(GetNodeData(Node)^); // Extract the payload of the node as a TObject so
                                                   // we can check it's type before proceeding.
  if not Assigned(PayloadObject) then
    CellText := 'Bug: Node payload not assigned'
  else if PayloadObject is TContact then
  begin
    Contact := TContact(PayloadObject);
    CellText := Contact.FirstName + ' ' + Contact.LastName + ' (' + Contact.PhoneNumber + ')';
  end
  else if PayloadObject is TContactCategory then
  begin
    ContactCategory := TContactCategory(PayloadObject);
    CellText := ContactCategory.CategoryName + ' (' + IntToStr(ContactCategory.Count) + ' contacts)';
  end
  else if PayloadObject is TNode then
  begin
    Node_ := TNode(PayloadObject); // We know it's a TNode, assign it to the proper var so we can easily work with it
    CellText := Node_.Name;
  end
  else
    CellText := 'Bug: don''t know how to extract CellText from ' + PayloadObject.ClassName;
end;

function TNode.AddItem(AClass: TNodeClass; AId: integer; AName: string): TNode;
begin
  if FItems=nil then
    FItems := TList.Create;
  if AClass=nil then
    result := TNode.Create
  else
    result := AClass.Create;
  result.Name := AName;
  result.Id := AId;
  FItems.Add(result);
end;

procedure TNode.Clear;
var
  i: Integer;
begin
  if FItems=nil then exit;
  for i:=0 to FItems.Count-1 do
    TObject(FItems[i]).Free;
end;

destructor TNode.Destroy;
begin
  Clear;
  FItems.Free;
  inherited;
end;

function TNode.GetItem(AIndex: integer): TNode;
begin
  if FItems=nil then
    result := Nil
  else
    result :=  TNode(FItems[AIndex]);
end;

function TNode.GetItemCount: integer;
begin
  if FItems=nil then
    result := 0
  else
    result := FItems.Count;
end;

end.

